import React,{ Component } from 'react';


class Hello extends Component{

    constructor(props){
        super(props)
        this.state={
            'message':"this is state message"
        }
        this.props={'raju':"raju123"};
    }

     changeState(){
this.setState({'message':"diana"})
    }
    render() {
        const {name,email,raju}=this.props
        return (
            <div>

                <h1>{this.state.message}</h1>
                
                <h1>{name}-{email}-{props.raju} </h1>
                <button onClick={()=>this.changeState()}>subscribe</button>
            </div>
        )
    }
}
export default Hello
